<script>
import wepy from "wepy";
import { shttp } from "../utils/http";
export default class Mine extends wepy.page {
  config = {
    navigationBarTitleText: "我的"
  };
  data = {
    //用户信息
    userInfo: ""
  };

  components = {};

  onLoad(options) {
    this.userInfo = wx.getStorageSync("memberInfo");
  }
  onShow() {}
  methods = {
    //退出登录
    logout() {
      wx.showModal({
        title: "提示",
        content: "是否退出登录",
        success: function(res) {
          if (res.confirm) {
            console.log("用户点击确定");
            wx.clearStorage();
            wx.showToast({
              title: "已退出登录",
              icon: "none",
              duration: 1000
            });
            setTimeout(() => {
              wx.redirectTo({
                url: "/pages/login/login"
              });
            }, 2000);
          } else if (res.cancel) {
            console.log("用户点击取消");
          }
        }
      });
    }
  };
}
</script>